        people: {
            name: string
            age: number
        }[]
    }

    const [people, setPeople] = useState<User["people"]>([
        {
        name: "ali",
        age: 19},
        {
        name: "otto",
        age: 13
        },
        {
        name: "un",
        age: 21
        }

             


    ])

    people.map(item => item.age = 3)


    return(
        <div>
        <h1>hello</h1>
        <List data = {people}/>
        </div>
    )
}
